function Table(props) {
  return (
    <tr>
      <td>{props.song}</td>
      <td>{props.score}</td>
      <td>
        <button onClick={props.upvote}>upvote</button>
      </td>
      <td>
        <button onClick={props.downvote}>downvote</button>
      </td>
    </tr>
  );
}

export default Table;
